// import React
import React from "react";
// import React Bootstrap components
import { Navbar, Nav, Container, Row, Col } from "react-bootstrap";
// import CSS file
import "./styles.css";

function Homepage() {
  return (
    <div>
      {/* Header */}
      <Navbar bg="light" expand="lg" className="navbar">
        <Container>
          <Navbar.Brand href="#">Logo</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="ml-auto">
              <Nav.Link href="#">Home</Nav.Link>
              <Nav.Link href="#">About</Nav.Link>
              <Nav.Link href="#">Products</Nav.Link>
              <Nav.Link href="#">Contact</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      {/* Top video */}
      <div className="top-video">{/* Add your video component here */}</div>

      {/* Main section */}
      <Container className="main-section">
        <Row>
          {/* Subsection 1 */}
          <Col md={6}>
            <div className="subsection">{/* Content for subsection 1 */}</div>
          </Col>

          {/* Subsection 2 */}
          <Col md={6}>
            <div className="subsection">{/* Content for subsection 2 */}</div>
          </Col>
        </Row>

        <Row>
          {/* Subsection 3 */}
          <Col md={4}>
            <div className="subsection">{/* Content for subsection 3 */}</div>
          </Col>

          {/* Subsection 4 */}
          <Col md={4}>
            <div className="subsection">{/* Content for subsection 4 */}</div>
          </Col>

          {/* Subsection 5 */}
          <Col md={4}>
            <div className="subsection">{/* Content for subsection 5 */}</div>
          </Col>
        </Row>
      </Container>

      {/* Footer */}
      <footer className="footer">{/* Footer content */}</footer>
    </div>
  );
}

export default Homepage;
